$(function(){

// mobile menu має бути 1
	$('#nav_home').slimmenu({
	    resizeWidth: '1100',
	    collapserTitle: 'Menu',
	    animSpeed:'medium',
	    indentChildren: true,
	    childrenIndenter: '&raquo;'
	});


	$('.horizon').horizon();
	$('.main_afisha a span').horizon();


	$(window).scroll(function(){
		if ($(this).scrollTop() > 100) {
			$('#up').fadeIn();
			$('#top-wrapper').css({
				'height':'80px',
				'width':'100%',
				'background':'rgba(0,0,0,1)'
			});
			$('#logo').css({
				'width':'100px',
				'padding':'0 10px'
			});
			$('#logo img').css({
				'height':'80px'
			});
			$('#menu').css({
				'width':'calc(100% - 200px)',
				 'padding-top': '10px'
			});
			$('#lang').css('padding-top','25px');
		} else {
			$('#up').fadeOut();
			$('#top-wrapper').css({
				'height':'auto',
				'width':'1200px',
				'background':'rgba(0,0,0,0)'
			});
			$('#logo').css({
				'width':'200px',
				'padding':'20px 0 0'
			});
			$('#logo img').css({
				'height':'120px'
			});
			$('#menu').css({
				'width':'calc(100% - 300px)',
				 'padding-top': '60px'
			});
			$('#lang').css('padding-top','80px');
	}


	if  ($(window).scrollTop() == $(document).height() - $(window).height()){
		 $('#social').addClass('footer-social');
		 $('#social .title').css('display','block');
	} else {
		 $('#social').removeClass('footer-social');
		 $('#social .title').css('display','none');
	}


// паралакс
	$.stellar({
		horizontalScrolling: false,
		verticalOffset: 40
	});

// gallery
	$("[data-fancybox]").fancybox();


	

});

// вгору
$('#up').click(function(){
	$("html, body").animate({ scrollTop: 0 }, 600);
		return false;
	});
});


// плавне зникання сигнатури
$(window).on('scroll', function() {
	var percent = 0.003;

	$('.signature img').css({
		opacity: 1 - $(window).scrollTop() * percent
	})
});


// end
